export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},"2ix3kdVz5g":{data:{id:2453,attributes:{imdbId:"tt5208216",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjM3NjY0MTYwM15BMl5BanBnXkFtZTgwMDI5NzA2MzI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"68%"},{Source:"Metacritic",Value:"71\u002F100"}],item_lang:{data:{id:3116,attributes:{title:c,plot:"The film interlaces two stories set fifty years apart, switching frequently between them. Each tells the story of a child's quest. In 1927, Rose runs away from her father's New Jersey home to find her mother\u002Fidol, the actress Lillian Mayhew. In 1977, recently orphaned Ben runs away from his Minnesota home in search of his father..",slug:"wonderstruck"}}},books:{data:[{id:11858,attributes:{title:c,description:"Having lost his mother and his hearing in a short time, twelve-year-old Ben leaves his Minnesota home in 1977 to seek the father he never knew in New York City, and meets there Rose, who is also longing for something missing from her life. Ben's story istold in words; Rose's in pictures.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VN6VFxGA0O8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2011-01-01",publisher:d,subtitle:"A Novel in Words and Pictures"}},{id:11859,attributes:{title:c,description:i,thumbnail:j,authors:[a],firstBook:e,published:k,publisher:d,subtitle:f}},{id:11860,attributes:{title:c,description:i,thumbnail:j,authors:[a],firstBook:e,published:k,publisher:d,subtitle:f}},{id:11861,attributes:{title:"Kaleidoscope",description:"An astounding new feat of storytelling from Brian Selznick, the award-winning creator of The Invention of Hugo Cabret and Wonderstruck. A ship. A garden. A library. A key. In Kaleidoscope, the incomparable Brian Selznick presents the story of two people bound to each other through time and space, memory and dreams. At the center of their relationship is a mystery about the nature of grief and love which will look different to each reader. Kaleidoscope is a feat of storytelling that illuminates how even the wildest tales can help us in the hardest times.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VuUfEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2021-09-21",publisher:d,subtitle:f}},{id:11862,attributes:{title:"The Wonderstruck Movie Scrapbook",description:"Selznick, who wrote the screenplay to the movie adaptation of his #1 New York Times bestseller, Wonderstruck, gives a breezy, personal behind-the-scenes tour of the making of the movie. The easy to browse pages are filled with fun set photos, film stills, lively text, and quotes from cast and crew, inviting readers to relive the movie and learn a little about filmmaking. Designed as a double-sided, reversible book, it echoes the look of the movie -- one half in the groovy color of the 1970s, and the other featuring glamorous black and white of the 1920s. An immersive experience for Brian Selznick fans and movie-goers of all ages.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r9DCAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2017-10-01",publisher:"Scholastic Press",subtitle:f}}]}}},meta:{}}},prerenderedAt:1681377207900}}("Brian Selznick","movie","Wonderstruck","Scholastic Inc.",null,"","series",1,"Caldecott Medalist Brian Selznick's #1 NY Times bestseller is now available in ebook form! Exquisitely produced, it offers a unique reading experience, you'll want both the print and ebook editions! Playing with the form he created in his trailblazing debut novel, The Invention of Hugo Cabret, Brian Selznick once again sails into uncharted territory and takes readers on an awe-inspiring journey. Ben and Rose secretly wish their lives were different. Ben longs for the father he has never known. Rose dreams of a mysterious actress whose life she chronicles in a scrapbook. When Ben discovers a puzzling clue in his mother's room and Rose reads an enticing headline in the newspaper, both children set out alone on desperate quests to find what they are missing. Set fifty years apart, these two independent stories -- Ben's told in words, Rose's in pictures -- weave back and forth with mesmerizing symmetry. How they unfold and ultimately intertwine will surprise you, challenge you, and leave you breathless with wonder. Rich, complex, affecting, and beautiful -- with over 460 pages of original artwork -- Wonderstruck is a stunning achievement from a uniquely gifted artist and visionary.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_hwoCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-09-15"))